import React, {useState} from "react";
import "./styles/styles.scss";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from "./components/Pages/Home/Home";
import CompletedConnectForm from "./components/Layout/CompletedConnectForm/index";


export default function App() {
  const [completedForm, setCompletedForm] = useState(true)
  const openCompeletedForm = ()=> {setCompletedForm(false)}
  const closeCompletedForm = () => {setCompletedForm(true)}

  return (
    <BrowserRouter>
      <Routes>
        <Link to="/" onClick={openCompeletedForm}>Home</Link>
        <Link to="/CompletedConnectForm" onClick={closeCompletedForm}></Link>
        <Route path="/" element={<Home />} />
      </Routes>
    </BrowserRouter>
  );
}
